import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function New() {
  return (
    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="https://cdn.cipherlab.com/comm/upimage/f-170821-03556.jpg" />
      <Card.Body>
        <Card.Title>Card Title</Card.Title>
        <Card.Text>
          <h3>Some quick example text to build on the card title and make up the
          bulk of the card's content.</h3>
        </Card.Text>
        {/* <Button variant="primary">Go somewhere</Button> */}
      </Card.Body>
    </Card>
  );
}

export default New;
